import React, { useEffect, useState } from "react"
import data from './data/db.json'
import { Grid, Paper } from "@mui/material";

export default function Notes() {
    return (
        <Grid container>
            {data.notes.map(note => (
                <Grid item md={4} xs={12} sm={6} key = {note.id}>
                    <Paper>{note.title}</Paper>
                </Grid>
            ))}

        </Grid>

    )
}
